window.bookSummaryJSON = "<p>My name is Ace Bisset, and I've finally embraced what it means to be a witch. <br> <br> But even with all my newfound power, I still haven't figured out how to break this damned curse. And that's a problem, because time is running out. In order to save the four men I’ve grown to love more than life itself, I have to search deep within my powers and find the key to breaking the dark magic trapping my friends to the night. <br> <br> But just when I think I might be getting close to breaking the curse, a new big bad comes into town, and he knows a lot about me. Turns out he’s been watching me, waiting for this very moment. If I don’t stop him from carrying out his plans, then it won’t matter if I can break the curse or not. <br> <br> Because we’ll all be cursed. <br> <br> <b>Don't miss the FINAL book in the Her Dark Protector's series. Scroll up and grab your copy today!</b></p>"; 
